  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Arapaho NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Arapaho NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge resources, information
  about the management direction, strategies for implementation and monitoring, and
  a socioeconomic analysis. Key planning issues include: prairie dogs, Pole Mountain,
  grazing, elk, sage grouse management, inholdings, and invasive plants.\",\n\t\"license_title\":
